import React from 'react'
import { useStateValue } from '../cart/gear/state'

//Add items to cart
function ShowCart() {
  const [{cart}] = useStateValue()

  const cartItems = cart.map(items => (
      <div key={items.id}>
          <h1>{items.name}</h1>
          <h2>{items.price}</h2>
      </div>
  ))

  return (
      <>
        <div className="container">
            <div className="row">
                <div className="col-sm-12">
                    <ul>
                        <li>{cartItems}</li>
                    </ul>
                </div>
            </div>
        </div>
      </>
  )
}

export default ShowCart
